import React, { Component } from 'react';
import './HeaderHome.css';
import { Link } from 'react-router-dom';
import { Navbar } from 'react-bootstrap';
//Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

export default class HeaderHome extends Component {
    render() {
        return (
            <Navbar default collapseOnSelect>
                <Link to="/Signup" className="button-align"><button className="signup-home">SIGN UP</button></Link>
                <Link to="/Signin" className="button-align"><button className="signin-home">SIGN IN</button></Link>
            </Navbar>

        );
    }
}
